import { Button, Typography } from "@mui/material";

function Header(): JSX.Element {
    return (
        <div className="header">
  <Box></Box>
        <Typography>כלי לבדיקת מספרי טלפון מול מאגר ״אל תתקשר אליי״</Typography>
        <div className="nav">
        <Button className="app-button" variant="outlined">הנחיות החוק</Button>
        <Button className="app-button" variant="outlined">הגדרת פרטי עסק</Button>

        </div>
         </div>
    );
}

export default Header;
